/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `tg_Limite_AlunoporTurma` BEFORE INSERT ON `tbmatricula` FOR EACH ROW BEGIN 
DECLARE num_insercoes INT;
	SELECT COUNT(*) INTO num_insercoes
    FROM tbmatricula m WHERE m.codturma = NEW.codturma;

IF num_insercoes >= 30 THEN
	SIGNAL SQLSTATE "45000" SET MESSAGE_TEXT = "LIMITE DE ALUNOS POR TURMA ATINGIDO!";
	END IF;
END */;;
DELIMITER ;
