/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `tg_limite_DisciplinaporSemestre` BEFORE INSERT ON `tbmatricula` FOR EACH ROW BEGIN 
DECLARE num_insercoes INT;
	SELECT COUNT(*) INTO num_insercoes 
    FROM tbmatricula m WHERE
    m.codRA = NEW.codra AND
    m.semestre = NEW.semestre ;
    
IF num_insercoes >= 9 THEN
	SIGNAL SQLSTATE "45000" SET MESSAGE_TEXT = "LIMITE DE DISCIPLINAS POR ALUNO ATINGIDO!";
    END IF;
END */;;
DELIMITER ;
