/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `tg_limite_alunos_Ano` BEFORE INSERT ON `tbmatricula` FOR EACH ROW BEGIN 
     DECLARE num_insercoes_ano INT;
     SELECT count(*) INTO num_insercoes_ano 
     FROM tbmatricula 
     where year(curdate()) = year(new.data_matricula);
IF num_insercoes_ano >= 300 THEN
	SIGNAL SQLSTATE "45000" SET MESSAGE_TEXT = "LIMITE DE MATRICULAS POR ANO ATINGIDO!";
    
    END IF;
    
END */;;
DELIMITER ;
